import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'


const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Link smooth to="/about"><NavigationButton>About</NavigationButton></Link>
                <Link smooth to="/experience"><NavigationButton>Experience</NavigationButton></Link>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
